import './App.css';
import axios from 'axios';
import { useEffect, useState } from 'react';

export default function App(){
  const [data, setData] = useState([]);

  let getData = async() => {
    let response = await axios.get('localhost:5050/data')
    setData(response)
    return response
  }

  useEffect(() => {
    getData()
  }, []);
  return (
    <>
    {/* navbar */}
    <div className='h-[100px] flex flex-col border bg-red-600'>
      <div className='px-5 py-4'>
        <div>Liga 1</div>
      </div>
      <div className='flex flex-row justify-center gap-4 text-lg'>
        <div className='active:text-white hover:text-white'>Pertandingan</div>
        <div className='active:text-white hover:text-white'>Berita</div>
        <div className='active:text-white hover:text-white'>Klasemen</div>
        <div className='active:text-white hover:text-white'>Statistik</div>
        <div className='active:text-white hover:text-white'>Pemain</div>
      </div>
    </div>
    <div className='bg-slate-200 h-[90px] px-3 py-3'>
        <div className='flex flex-col'>
          <p>Musim</p>
          <select className='w-[100px]'>
            <option>2022-2023</option>
            <option>2021-2022</option>
            <option>2020-2021</option>
          </select>
        </div>
      </div>
    {/* content */}
    <div>
        <div></div>
    </div>
    </>
  );
}
